import React, { Component } from 'react'; 
import headshot from './assets/headshot.jpg'


class About extends Component {
    render() {
        return(
            <div>
                <h1>Hi! I'm Jess.</h1>
                <div className="content-container">


                <img src={headshot} />
                <p>I am currently a Tech Consultant at Adobe in NYC working on the Campaign team. I majored in Digital Media Design and 
                    minored in Fine Arts at the University of Pennsylvania, where I graduated from the 
                    School of Engineering in May 2019.<br></br>
                    In my free time, I love cartooning, doodling, watching stand up, playing with my two cats, and running. </p>
                <p>Inspired by old New Yorker cartoons, I decided to start my own cartoon instagram, Peng and Ink,
                    a year ago as an outlet to showcase my humor and creativity. If you like cartoons or just want a laugh,
                    feel free to check it out!</p>
                </div>
            </div>
        )                    
    }
}

export default About;
